import numpy as np
from scipy.stats import pearsonr

adv_np = advantages.cpu().numpy()
pr_np  = prm_reward.cpu().numpy()

# 只保留 adv 和 pr 都非零的索引（可选）
mask = (adv_np != 0)
adv_nz = adv_np[mask]
pr_nz  = pr_np[mask]

# 对 pr_nz 做 softmax 归一化，变成合法的“概率分布”
exp_pr = np.exp(pr_nz - np.max(pr_nz))
probs  = exp_pr / exp_pr.sum()

# 计算每个 token 的熵
entropy = -(probs * np.log(probs + 1e-12))

# 再做 Pearson 相关
r_ent, p_ent = pearsonr(entropy, adv_nz)
print(f"Pearson r (entropy vs. advantage): {r_ent:.4f}, p-value = {p_ent:.3g}")